Content:
@everyone I've created this channel for the purpose of members mingling in real life. Seeing as many members of the community often meet up, I've made it easier for you guys to ping meetups. Whenever you're alone just hit up your position wherever to see if a member is near you. Anyways, you guys can ping this role @Offline Meeting whenever you want to meet somewhere.

For now, if you want the role, type in "I would like the green stuff please" on the chat I shall grant it to you.

Remember, **ARRANGE MEETUPS WITH PEOPLE YOU'RE COMFORTABLE OR FAMILIAR WITH, WE CANNOT MODERATE SAFETY OUTSIDE OF DISCORD**.
